import React from 'react';
import ReactDOM from 'react-dom';

let mainBoxStyle = {
  width:"615px",
  height:"100px",
  border: "2px solid #bfbcbc54",
  backgroundColor:"#d3d3d32e",
  paddingLeft: "15px",
  paddingTop: "15px",
  margin: "100px auto"

}
let textStyle = {
  position: "absolute",
  top:"40%"
}
let blackBoxStyle = {
  width:"200px",
  height:"80px",
  backgroundColor: "black",
  fontSize: "20px",
  textAlign: "center",
  color: "yellow",
  float: "left",
  position: "relative"
}
/*Red box style*/
let redBoxStyle = {
  width:"200px",
  height:"80px",
  backgroundColor: "red",
  fontSize: "20px",
  textAlign: "center",
  color: "blue",
  float: "left",
  position: "relative"
}
/*Green Box style*/
let greenBoxStyle = {
  width:"200px",
  height:"80px",
  backgroundColor: "green",
  fontSize: "20px",
  textAlign: "center",
  color: "white",
  float: "left",
  position: "relative"
}


let BlackBox = () => <div style = {blackBoxStyle}><span style = {textStyle}>Yellow In Black</span> </div>;
let RedBox = () => <div style = {redBoxStyle}> Blue In Red </div>;
let GreenBox = () => <div style = {greenBoxStyle}> White In Green </div>;
let App = () => (
                <div style={mainBoxStyle}>
                  <BlackBox/>
                  <RedBox/>
                  <GreenBox/>
                </div>
              );


ReactDOM.render(
  <App/>,
  document.getElementById('root')

);
